    <p class=MsoNormal align=center style='text-align:center'><span
    style='font-size:15.0pt;line-height:106%;font-family:"Arial",sans-serif;
    color:#040C28'>América es un amplio continente que se extiende en el
    sentido de los meridianos, y además, tiene un largo desarrollo latitudinal</span><span
    style='font-size:15.0pt;line-height:106%;font-family:"Arial",sans-serif;
    color:#202124;background:white'><span style='font-variant-ligatures: normal;
    font-variant-caps: normal;orphans: 2;widows: 2;-webkit-text-stroke-width: 0px;
    text-decoration-thickness: initial;text-decoration-style: initial;
    text-decoration-color: initial;float:none;word-spacing:0px'>. América es la

    extensión aproximada de 42.262.142 km²</span></span></p>
